export function loadLevel3(scene) {
    let platforms = scene.physics.add.staticGroup()
    let objects = scene.physics.add.staticGroup()
    
    // Static platforms - challenging layout
    platforms.create(400, 698, "ground")
    platforms.create(100, 550, "island")
    platforms.create(700, 550, "island")
    platforms.create(400, 400, "island")
    
    // Dynamic platforms - extra unfair!
    let dynamicPlatforms = [];
    
    // Multiple bouncing platforms
    let platform1 = scene.physics.add.sprite(150, 250, "island").setImmovable(true);
    platform1.body.setAllowGravity(false);
    platform1.bouncingPlatform = true;
    platform1.bounceSpeed = 150;
    platform1.minY = 150;
    platform1.maxY = 350;
    platform1.setVelocityY(platform1.bounceSpeed);
    dynamicPlatforms.push(platform1);
    
    let platform2 = scene.physics.add.sprite(650, 250, "island").setImmovable(true);
    platform2.body.setAllowGravity(false);
    platform2.bouncingPlatform = true;
    platform2.bounceSpeed = 120;
    platform2.minY = 150;
    platform2.maxY = 350;
    platform2.setVelocityY(-platform2.bounceSpeed);
    dynamicPlatforms.push(platform2);
    
    // Trapped platforms everywhere
    let platform3 = scene.physics.add.sprite(400, 300, "island").setImmovable(true);
    platform3.body.setAllowGravity(false);
    platform3.trappedPlatform = true;
    platform3.triggered = false;
    dynamicPlatforms.push(platform3);
    
    // Floor holes
    let platform4 = scene.physics.add.sprite(100, 550, "island").setImmovable(true);
    platform4.body.setAllowGravity(false);
    platform4.openHole = true;
    platform4.holeActive = false;
    dynamicPlatforms.push(platform4);
    
    let platform5 = scene.physics.add.sprite(700, 550, "island").setImmovable(true);
    platform5.body.setAllowGravity(false);
    platform5.openHole = true;
    platform5.holeActive = false;
    dynamicPlatforms.push(platform5);
    
    // Platform that moves when you're on it
    let platform6 = scene.physics.add.sprite(400, 200, "island").setImmovable(true);
    platform6.body.setAllowGravity(false);
    platform6.movesWhenTouched = true;
    dynamicPlatforms.push(platform6);
    
    // Teleporters
    let teleporter1 = scene.physics.add.sprite(100, 530, "star").setScale(2);
    teleporter1.body.setAllowGravity(false);
    teleporter1.setTint(0xff00ff);
    teleporter1.isTeleporter = true;
    teleporter1.targetX = 700;
    teleporter1.targetY = 530;
    dynamicPlatforms.push(teleporter1);
    
    let teleporter2 = scene.physics.add.sprite(700, 530, "star").setScale(2);
    teleporter2.body.setAllowGravity(false);
    teleporter2.setTint(0xff00ff);
    teleporter2.isTeleporter = true;
    teleporter2.targetX = 100;
    teleporter2.targetY = 530;
    dynamicPlatforms.push(teleporter2);
    
    let portal = scene.physics.add.sprite(400, 150, "portal").setScale(2);
    portal.body.setAllowGravity(false);
    
    return { 
        platforms, 
        portal,
        dynamicPlatforms
    };
}

export function updateLevel3(scene, player, dynamicPlatforms) {
    if (!dynamicPlatforms || dynamicPlatforms.length === 0) return;
    
    dynamicPlatforms.forEach(platform => {
        // Teleporters
        if (platform.isTeleporter) {
            platform.setAlpha(0.5 + Math.sin(scene.time.now / 200) * 0.5);
            
            if (scene.physics.overlap(player, platform)) {
                if (!platform.teleporting) {
                    platform.teleporting = true;
                    player.setPosition(platform.targetX, platform.targetY);
                    player.setVelocity(0, 0);
                    scene.time.delayedCall(500, () => {
                        platform.teleporting = false;
                    });
                }
            }
        }
        
        // Bouncing platforms
        if (platform.bouncingPlatform) {
            if (platform.y >= platform.maxY && platform.body.velocity.y > 0) {
                platform.setVelocityY(-platform.bounceSpeed);
            } else if (platform.y <= platform.minY && platform.body.velocity.y < 0) {
                platform.setVelocityY(platform.bounceSpeed);
            }
        }
        
        // Trapped platforms
        if (platform.trappedPlatform && !platform.triggered) {
            if (scene.physics.world.collide(player, platform)) {
                platform.triggered = true;
                platform.setTint(0xff6600);
                scene.time.delayedCall(400, () => {
                    platform.setImmovable(false);
                    platform.body.setAllowGravity(true);
                    platform.setTint(0xff0000);
                });
            }
        }
        
        // Opening holes
        if (platform.openHole) {
            const distance = Math.abs(player.x - platform.x);
            if (distance < 60 && !platform.holeActive) {
                platform.holeActive = true;
                platform.body.checkCollision.none = true;
                platform.setAlpha(0);
                scene.time.delayedCall(3000, () => {
                    platform.holeActive = false;
                    platform.body.checkCollision.none = false;
                    platform.setAlpha(1);
                });
            }
        }
        
        // Platform that moves away when you touch it
        if (platform.movesWhenTouched) {
            if (scene.physics.world.collide(player, platform)) {
                platform.x += player.x > platform.x ? -3 : 3;
                platform.x = Phaser.Math.Clamp(platform.x, 100, 700);
            }
        }
    });
}
